import Header from "./components/Header/Header.js";
import { Route } from "react-router-dom";

function Layout(props) {
  return (
    <>
    <Header></Header>
      <main className="container pt-5">
        <Route {...props} />
      </main>
    </>
  )
}

export default Layout;
